import React from 'react'
import { ScatterChart, Scatter, XAxis, YAxis, CartesianGrid, Tooltip, Legend, LabelList } from 'recharts';

    // axios.get, watch Building Your First Web Application - iMProgrammer @ 1:20:21 https://www.youtube.com/watch?v=NzpbupWoIV4

function StdDevChart() {
    const data = [
      { x: 1, y: 2, stddev: 0.5 },
      { x: 2, y: 3, stddev: 0.3 },
      // add more data points as needed
    ];

    return (
      <ScatterChart
        width={800}
        height={400}
        margin={{ top: 20, right: 20, bottom: 20, left: 20 }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis type="number" dataKey="x" name="X" />
        <YAxis type="number" dataKey="y" name="Y" />
        <Tooltip cursor={{ strokeDasharray: '3 3' }} />
        <Legend />
        <Scatter name="Data" data={data} fill="#8884d8">
          <LabelList dataKey="stddev" position="top" />
        </Scatter>
      </ScatterChart>
    );
  }

export default StdDevChart
